import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import {AuthRoute, UnAuthRoute} from './utils/AuthRoute';

import Container from "@material-ui/core/Container";

import NavHeader from './Components/navHeader';
import Page from './Components/page';
import Login from './Pages/login';
import Register from './Pages/register';
import Itineraries from './Pages/itineraries';
import PlaceContextProvider from './Store/PlaceContext';
import { AuthContextProvider } from './Store/AuthContext';


function App() {
  return (
    <Container maxWidth="lg">
      <AuthContextProvider>
        <PlaceContextProvider>
          <BrowserRouter>
            <NavHeader/>
            <Route exact path='/' component={Page}/>
            <AuthRoute exact path='/login' component={Login}/>
            <AuthRoute exact path='/register' component={Register}/>
            <UnAuthRoute exact path='/itineraries' component={Itineraries}/>
            <UnAuthRoute exact path='/itinerary/:itineraryId' component={Page}/>
          </BrowserRouter>
        </PlaceContextProvider>
      </AuthContextProvider>
    </Container> 
  );
}

export default App;
